import React, { useState, useEffect } from 'react';
import bridge from '@vkontakte/vk-bridge';
import { 
	View, 
	AdaptivityProvider, 
	AppRoot, 
	ConfigProvider, 
	SplitLayout, 
	SplitCol, 
	Epic, 
	useAdaptivityConditionalRender, 
	Tabbar, 
	TabbarItem, 
	Badge, 
	usePlatform, 
	Platform, 
	PanelHeader, 
	Panel, 
	Group, 
	PanelHeaderBack, 
	Placeholder, 
} from '@vkontakte/vkui';
import '@vkontakte/vkui/dist/vkui.css';
import Home from './panels/Home/Home';
import Persik from './panels/Home/Persik';
import Questions from './panels/Questions/Questions';
import { Icon28AccessibilityOutline, Icon28MessageOutline, Icon28Newsfeed, Icon28NewsfeedOutline, Icon28UserCircleOutline } from '@vkontakte/icons';
import PlusWidth from './components/maxWidthPlus';
import Create from './panels/Create/Create';
import {PANEL_PRODUCT_ITEM, VIEW_PRODUCT_ITEM} from './index.js'
import { useLocation, useRouter } from '@happysanta/router';
import QueseContainer from './components/Queses/QueseContainer';


const App = () => {
	const [fetchedUser, setUser] = useState(null);
	const platform = usePlatform();
	const { viewWidth } = useAdaptivityConditionalRender();
	const [activeStory, setActiveStory] = React.useState('home');
  const [friends, setFriends] = useState(null)
	const onStoryChange = (e) => setActiveStory(e.currentTarget.dataset.story);
	const isVKCOM = platform !== Platform.VKCOM;

	useEffect(() => {
		async function fetchData() {
			const user = await bridge.send('VKWebAppGetUserInfo');
			setUser(user);
			setPopout(null);
		}
		fetchData();
    bridge.send('VKWebAppGetFriends', {
      multi: true
    })
  .then((data) => { 
    if (data.users) {
      setFriends(data.users)
    }
  })
  .catch((error) => {
    // Ошибка
    console.log(error);
  });
	}, []);
  const router = useRouter()
  const location = useLocation()

  // return (
  //   <View id={VIEW_MAIN} activePanel={location.getViewActivePanel(VIEW_MAIN)}>
  //     <Home id={PANEL_MAIN} />
  //   </View>
  // )

	return (
		<ConfigProvider>
			<AdaptivityProvider>
				<AppRoot>
				<SplitLayout
					header={isVKCOM && <PanelHeader separator={false} />}
					style={{ justifyContent: 'center' }}
					>
					{viewWidth.tabletPlus && (
						<SplitCol className={viewWidth.tabletPlus.className} width={280} maxWidth={280}>
							<PlusWidth 
								viewWidth={viewWidth}
								isVKCOM={isVKCOM}
								activeStory={activeStory}
								onStoryChange={onStoryChange}
								fetchedUser={fetchedUser}
							/>
						</SplitCol>
					)}

      <SplitCol width="100%" maxWidth="800px" stretchedOnMobile autoSpaced>
        <Epic
          activeStory={activeStory}
          tabbar={
            viewWidth.tabletMinus && (
              <Tabbar className={viewWidth.tabletMinus.className}>
                <TabbarItem
                  onClick={onStoryChange}
                  selected={activeStory === 'home'}
                  data-story="home"
                  text="Главная"
                >
                  <Icon28Newsfeed />
                </TabbarItem>
                <TabbarItem
                  onClick={onStoryChange}
                  selected={activeStory === 'friends'}
                  data-story="friends"
                  text="Друзья"
                >
                  <Icon28NewsfeedOutline />
                </TabbarItem>
				{fetchedUser && <TabbarItem
                  onClick={onStoryChange}
                  selected={activeStory === 'create'}
                  data-story="create"
                  text="Создать"
                >
                  <Icon28NewsfeedOutline />
                </TabbarItem>}
              </Tabbar>
            )
          }
        >
          <View id="profile" activePanel="profile">
            <Questions id="profile" go={onStoryChange} />
          </View>
          <View id="home" activePanel="home">
            <Home id="home" go={onStoryChange} fetchedUser={fetchedUser} />
          </View>
          <View id="friends" activePanel="friends">
            <Questions id='friends' friends={friends} />
          </View>
          <View id="create" activePanel="create">
            <Create id="create" fetchedUser={fetchedUser} />
          </View>
          <View id={VIEW_PRODUCT_ITEM} onSwipeBack={() => router.popPage()}>
            <QueseContainer ids={PANEL_PRODUCT_ITEM} />
          </View>

        </Epic>
      </SplitCol>
    </SplitLayout>
				</AppRoot>
			</AdaptivityProvider>
		</ConfigProvider>
	);
}

export default App;
